import { config } from 'dotenv'
import { CompositeCollectionFragmentEntity } from '../src/compositecollectionfragment/compositecollectionfragment.entity'

import { getDatabaseConnection } from './common'
import { promises as fs } from 'fs';
import path from "path"
import { SyntheticItemLayerEntity } from '../src/syntheticitemlayer/syntheticitemlayer.entity'
import { syntheticPartToDto } from '../src/compositeapi/compositeapi.utils'
import { CompositeConfigDto, CompositeConfigLayer } from '../src/compositeapi/dtos/index.dto'
import sharp from "sharp"
import axios from "axios"
import Jimp from 'jimp/es';
import { execSync } from "child_process"

//import distance from "sharp-phash/distance"
config()

async function main() {
    //just for movr because we dont have an indexer
    const connection = await getDatabaseConnection("zindexshitshow")
    const result = await connection.manager.findOne<CompositeCollectionFragmentEntity>(CompositeCollectionFragmentEntity, { collection: { chainId: 1, assetAddress: "0xac5c7493036de60e63eb81c5e9a440b42f47ebf5"?.toLowerCase() } }, { relations: ["syntheticParts", "collection", "syntheticParts.items", "syntheticParts.items.layers", "compositeParts"] })
    if (!result) {
        throw new Error("This asset is not permissioned for customization.")
    }

    const resp: CompositeConfigDto = {
        chainId: result.collection.chainId,
        assetAddress: result.collection.assetAddress,
        assetType: result.collection.assetType,
        name: result.collection.name,
        parts: result.syntheticParts.map(p => syntheticPartToDto(p, result.collection.chainId)).filter(p => !!p)
    }

    const eMeta = await fs.readFile("/Users/me/Desktop/exo_metadata/allmeta.json")
    const exoMetadata = JSON.parse(eMeta.toString())
    const OUTPUT_FOLDER = `/Users/me/Downloads/exo_truth`

    if (OUTPUT_FOLDER.length > 10) {
        execSync(`rm -rf ${OUTPUT_FOLDER}`)
        execSync(`mkdir -p ${OUTPUT_FOLDER}`)

    }

    for (const exoMeta of exoMetadata) {
        await processExo(exoMeta, (exoMetadata.indexOf(exoMeta) + 1))
    }

    async function processExo(exoMeta: any, num: number) {

        const buf = await fs.readFile(`/Users/me/Downloads/exo_all/exo_${num}.jpg`)
        const jTruthImg = await Jimp.read(buf)

        let allLayers: CompositeConfigLayer[] = []

        for (const trait of exoMeta) {
            if (["Eyes", "Gen", "Breed Counter"].includes(trait.trait_type)) {
                continue
            }
            if (["Vibe"].includes(trait.trait_type)) {
                continue
            }

            let matchingPart = resp.parts.find(p => p.name === trait.trait_type)

            if (!matchingPart) {
                console.log(`Couldn't find matching synthetic part for ${trait.trait_type}`)
                process.exit()
            }
            if (!matchingPart.items) {
                console.log(JSON.stringify(matchingPart))
            }
            if (trait.value !== "None") {
                let item
                if (["Expression"].includes(trait.trait_type)) {
                    const bodyTrait = exoMeta.find((t: any) => t.trait_type === "Body")
                    const expressionTrait = exoMeta.find((t: any) => t.trait_type === "Expression")
                    const vibeTrait = exoMeta.find((t: any) => t.trait_type === "Vibe")
                    const jsonTraits = JSON.stringify([expressionTrait, bodyTrait, vibeTrait])
                    item = matchingPart.items.find(i => JSON.stringify(i.attributes) === jsonTraits)

                } else {
                    item = matchingPart.items.find(i => i.attributes[0].value === trait.value)
                }
                allLayers = [...allLayers, ...item.layers]
            }

        }
        await compositeImage(allLayers, `${OUTPUT_FOLDER}/${num}b.png`)
        const bufTwo = await fs.readFile(`${OUTPUT_FOLDER}/${num}b.png`)
        const jCompositedImg = await Jimp.read(bufTwo)
        const diff = Jimp.diff(jTruthImg, jCompositedImg, .1)
        // diff.image.write(`${OUTPUT_FOLDER}/${num}c.png`)
        console.log(`Exo #${num} diff: ${diff.percent}`)
        if (diff.percent > .009) {
            await fs.writeFile(`${OUTPUT_FOLDER}/${num}a.png`, buf)

            console.log(`EXO ${num} doesn't match`)
        } else {
            await fs.unlink(`${OUTPUT_FOLDER}/${num}b.png`)
        }

    }
    // process.exit(0);
}

async function compositeImage(layers: CompositeConfigLayer[], outputPath: string) {
    const sortedLayers: CompositeConfigLayer[] = layers.sort((a, b) => a.zIndex - b.zIndex)
    const imageBuffers = await Promise.all(sortedLayers.map((l: CompositeConfigLayer) => imageUrlToBuffer(`https://dev.static.moonsama.com${l.imageUri}`)))


    await sharp(Buffer.from(DUMMY_IMAGE, "base64"))
        .composite(imageBuffers.map(i => ({ input: i })))
        .toFile(outputPath);
}
async function imageUrlToBuffer(imageUrl: string) {
    const input = (await axios({ url: imageUrl, responseType: "arraybuffer" })).data as Buffer;
    return input
}

main()

var DUMMY_IMAGE = ""